import React from 'react';
import { List, message, Avatar, Spin } from 'antd';
import InfiniteScroll from 'react-infinite-scroller';
import './list.css' ;


const InfiniteListExample = ({data}) => {

  console.log('DATA DATA ', data)

    return (


          <List className='root' dataSource={data}>
            {data.map(item => (
              <List.Item>
                <div>{item.transaction_details.vendor}</div>
                <div>{item.transaction_details.category}</div>
                <div>{item.transaction_details.total}</div>
              </List.Item>
            ))}
          </List>


    );

}

export default InfiniteListExample ;
